import React from 'react';
import "./Main.css";
import { observable } from "mobx";
import { observer } from "mobx-react";

@observer
export default class Main extends React.Component<{}> {

    render() {
        return (
            <div>
                <span className={'heading'}>samwilkins.me</span>
            </div>
        )
    }

}
